-- HOMEWORK 1

#
# TABLE STRUCTURE FOR: khachhang
#

DROP TABLE IF EXISTS `khachhang`;

CREATE TABLE `khachhang` (
  `makh` varchar(40) CHARACTER SET utf8 NOT NULL,
  `hoten` varchar(40) CHARACTER SET utf8 DEFAULT NULL,
  `sdt` varchar(40) CHARACTER SET utf8 DEFAULT NULL,
  `coquan` varchar(40) CHARACTER SET utf8 DEFAULT NULL,
  PRIMARY KEY (`makh`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci;


#
# TABLE STRUCTURE FOR: nhachothue
#

DROP TABLE IF EXISTS `nhachothue`;

CREATE TABLE `nhachothue` (
  `manha` varchar(40) CHARACTER SET utf8 NOT NULL,
  `diachi` varchar(40) CHARACTER SET utf8 DEFAULT NULL,
  `giathue` int(11) DEFAULT NULL,
  `tenchunha` varchar(40) CHARACTER SET utf8 DEFAULT NULL,
  PRIMARY KEY (`manha`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci;



#
# TABLE STRUCTURE FOR: hopdong
#

DROP TABLE IF EXISTS `hopdong`;

CREATE TABLE `hopdong` (
  `makh` varchar(40) CHARACTER SET utf8 DEFAULT NULL,
  `manha` varchar(40) CHARACTER SET utf8 DEFAULT NULL,
  `ngaybatday` date DEFAULT NULL,
  `ngayketthuc` date DEFAULT NULL,
  KEY `makh` (`makh`),
  KEY `manha` (`manha`),
  CONSTRAINT `hopdong_ibfk_1` FOREIGN KEY (`makh`) REFERENCES `khachhang` (`makh`),
  CONSTRAINT `hopdong_ibfk_2` FOREIGN KEY (`manha`) REFERENCES `nhachothue` (`manha`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci;










