#
# TABLE STRUCTURE FOR: khach
#

DROP TABLE IF EXISTS `khach`;

CREATE TABLE `khach` (
  `makhach` varchar(40) CHARACTER SET utf8 NOT NULL,
  `hoten` varchar(40) CHARACTER SET utf8 DEFAULT NULL,
  `diachi` varchar(40) CHARACTER SET utf8 DEFAULT NULL,
  PRIMARY KEY (`makhach`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci;


#
# TABLE STRUCTURE FOR: khachsan
#

DROP TABLE IF EXISTS `khachsan`;

CREATE TABLE `khachsan` (
  `maks` varchar(40) CHARACTER SET utf8 NOT NULL,
  `tenks` varchar(40) CHARACTER SET utf8 DEFAULT NULL,
  `diachi` varchar(40) CHARACTER SET utf8 DEFAULT NULL,
  PRIMARY KEY (`maks`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci;



#
# TABLE STRUCTURE FOR: phong
#

DROP TABLE IF EXISTS `phong`;

CREATE TABLE `phong` (
  `sop` varchar(40) CHARACTER SET utf8 NOT NULL,
  `maks` varchar(40) CHARACTER SET utf8 NOT NULL,
  `loaip` varchar(40) CHARACTER SET utf8 DEFAULT NULL,
  `gia` int(11) DEFAULT NULL,
  PRIMARY KEY (`sop`,`maks`),
  KEY `maks` (`maks`),
  CONSTRAINT `phong_ibfk_1` FOREIGN KEY (`maks`) REFERENCES `khachsan` (`maks`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci;




#
# TABLE STRUCTURE FOR: datphong
#

DROP TABLE IF EXISTS `datphong`;

CREATE TABLE `datphong` (
  `maks` varchar(40) CHARACTER SET utf8 NOT NULL,
  `makhach` varchar(40) CHARACTER SET utf8 NOT NULL,
  `ngaynhan` date NOT NULL,
  `ngaytra` date DEFAULT NULL,
  `sop` varchar(40) CHARACTER SET utf8 DEFAULT NULL,
  PRIMARY KEY (`maks`,`makhach`,`ngaynhan`),
  KEY `makhach` (`makhach`),
  CONSTRAINT `datphong_ibfk_1` FOREIGN KEY (`maks`) REFERENCES `khachsan` (`maks`),
  CONSTRAINT `datphong_ibfk_2` FOREIGN KEY (`makhach`) REFERENCES `khach` (`makhach`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci;




















DELETE t1 FROM datphong t1
INNER JOIN datphong t2 
WHERE 
    t1.makhach = t2.makhach
and t1.ngaytra < t2.ngaytra;
		
